import React, { useState } from "react";
import { Modal, Button, Row, Col, Avatar, Typography } from "antd";

import { Container } from "./styles";
import star from "../../assets/star.png";
import fork from "../../assets/fork.png";
import eye from "../../assets/eye.png";

const { Text } = Typography;

export default function ModalDetail(
  isVisible: any,
  handleCancel: any,
  itemData: any
) {
  return (
    <>
      <Modal
        title="RepositÃ³rio"
        visible={isVisible}
        onCancel={isVisible.handleCancel}
        footer={[
          <Button key="back" onClick={isVisible.handleCancel}>
            Cancelar
          </Button>,
        ]}
      >
        <Container>
          {console.log("itemData", isVisible.itemData)}
          {console.log("isVisible", isVisible)}
          {console.log("handleCancel", handleCancel)}
          <Row>
            <Col>
              <Avatar
                size={64}
                src={
                  isVisible.itemData &&
                  isVisible.itemData.owner &&
                  isVisible.itemData.owner.avatar_url
                    ? isVisible.itemData.owner.avatar_url
                    : undefined
                }
                data-testid="avatar"
              />
            </Col>
            <Col>
              <Text>{isVisible.itemData.name}</Text>
            </Col>
          </Row>
          <Row>
            <Text strong>1234 Forks</Text>
          </Row>
          <Row>
            <Text strong>23123123 Stars</Text>
            <img src={star} alt="star" data-testid="star" className="star" />
          </Row>
          <Row>
            <Text strong>12312312 Watches</Text>
          </Row>
        </Container>
      </Modal>
    </>
  );
}
